let totalSum = 0;

function processdata (data) { 
    let sum = 0; 
    data.forEach((obj) => { 
        sum += obj.amount; 
        
    })
    return sum
}

function setHeight (data) { 
    data.forEach((obj) => { 
        if (obj.day === "mon") { 
            let newH = obj.amount;
            monChart.style.height = `${newH}%`;
            spendingMon.innerText="$"+`${newH}`; 
        } else if (obj.day === "tue") { 
            let newH = obj.amount;
            tueChart.style.height = `${newH}%`; 
            spendingTue.innerText="$"+`${newH}`; 
        } else if (obj.day === "wed") { 
            let newH = obj.amount;
            wedChart.style.height = `${newH}%`; 
