            spendingFri.innerText="$"+`${newH}`; 
        } else if (obj.day === "sat") { 
            let newH = obj.amount;
            satChart.style.height = `${newH}%`; 
            spendingSat.innerText="$"+`${newH}`; 
        } else if (obj.day === "sun") { 
            let newH = obj.amount;
            sunChart.style.height = `${newH}%`;
            spendingSun.innerText="$"+`${newH}`;  
        }
    })
}


